import { createRouter, createWebHistory } from 'vue-router';
import Home from '../views/HomeView.vue';

const routes = [
  {
    path: '/',
    name: 'Home',
    component: Home
  },
  {
    path: '/#about',
    name: 'About',
    component: Home
  },
  {
    path: '/#news',
    name: 'News',
    component: Home
  },
  {
    path: '/#publications',
    name: 'Publications',
    component: Home
  },
  {
    path: '/#projects',
    name: 'Projects',
    component: Home
  },
  {
    path: '/#education',
    name: 'Education',
    component: Home
  }
];

const router = createRouter({
  history: createWebHistory(),
  routes
});

export default router;
